content:
Утка по-пекински ( мясо уток (тушки),  сахар белый, соль пищевая,  приправа "5 специй" (бадьян молотый, перец сычуанский молотый, анис молотый, лакрица молотая, корица молотая), соус «Хойсин» (сахар белый, паста из соевых бобов (вода, соевые бобы, соль пищевая, мука пшеничная высший сорт), вода, соевый соус (вода, соевые бобы, соль пищевая, мука пшеничная высший сорт), уксус рисовый (вода, крупа рисовая), загуститель крахмал кукурузный, чеснок, пищевые красители (сахарный колер (I) простой, кармин), перец чили, специи, семена кунжута белого, антиокислитель аскорбат натрия, консервант сорбат калия), соус "Устричный" (вода, сахар белый, соль пищевая, устричный экстракт (устрицы, вода, соль пищевая), загуститель крахмал кукурузный модифицированный, усилитель вкуса и аромата глутамат натрия, пищевой краситель  сахарный колер (I), консервант сорбат калия), корень имбиря свежий, лук репчатый свежий, чеснок свежий, лук порей свежий, бадьян молотый, сахар, уксус столовый 9%,);

блинчики (мука  пшеничная высший сорт, загуститель крахмал кукурузный, вода питьевая, масло подсолнечное рафинированное дезодорированное,  масло кунжутное нерафинированное темное, соль пищевая); 
соус «Хойсин» (сахар белый, паста из соевых бобов (вода, соевые бобы, соль пищевая, мука пшеничная высший сорт), вода, соевый соус (вода, соевые бобы, соль пищевая, мука пшеничная высший сорт), уксус рисовый (вода, крупа рисовая), загуститель крахмал кукурузный, чеснок, пищевые красители (сахарный колер (I) простой, кармин), перец чили, специи, семена кунжута белого, антиокислитель аскорбат натрия, консервант сорбат калия), вода, сахар, чеснок свежий, масло подсолнечное рафинированное дезодорированное); 

огурцы свежие.

Котлета из говядины: говядина, вода питьевая, жир-сырец говяжий, бульон мясной жидкий концентрированный говяжий, смесь масел растительных (подсолнечное рафинированное дезодорированное высший сорт вымороженное, подсолнечное рафинированное дезодорированное первый сорт), лук, клетчатка соевая, мука пшеничная текстурированная, пищевые волокна (пшеничные), соль, загустители (конжаковая камедь, Е407, альгинат натрия, гуаровая камедь, ксантановая камедь), ароматизатор (содержит усилитель вкуса и аромата Е621, антиокислитель аскорбиновая кислота), перец черный, ароматизатор коптильный, стабилизаторы (Е450(i), E450(v)), продукт переработки крови черный альбумин говяжий, антиокислитель аскорбиновая кислота; 
Булка: мука пшеничная, сахар, масло растительное подсолнечное рафинированное дезодорированное, дрожжи, соль, семя кунжута, комплексная пищевая добавка улучшитель хлебопекарный (стабилизатор карбонат кальция, мука (соевая, пшеничная), эмульгатор Е472е, антиокислитель аскорбиновая кислота, вещество для обработки муки Е920, ферментные препараты микробного происхождения (альфа-Амилаза, ксиланаза));
Соус горчичный: масло растительное подсолнечное рафинированное дезодорированное, вода питьевая, желток яичный пастеризованный, томаты, семена горчицы, соль, сахар, мед, горчичный порошок, сливки питьевые стерилизованные, зелень петрушки сушеная, регуляторы кислотности (уксусная кислота ледяная, молочная кислота, лимонная кислота), загустители (гуаровая камедь, ксантановая камедь, Е407), лимонный сок сухой, мальтодекстрин, куркума, консерванты (сорбат калия, бензоат натрия), ароматизаторы натуральные (содержат горчицу), краситель каротины, антиокислитель (пиросульфит калия, Е385), пряности (кориандр, перец душистый, гвоздика, корица, базилик, мускатный орех, майоран, зира), паприка молотая, экстракты специй (содержат сельдерей), декстроза; Овощи: томаты, огурцы маринованные (огурцы, вода питьевая, сахар, соль, регулятор кислотности  уксусная кислота ледяная, укроп сушеный).
